import React from 'react';
import Img from 'react-image';


class App extends React.Component{
    render(){
        return(
            <div>
                <h1>Tourism</h1>
                <div className="row">

                    <Img src="https://images.pexels.com/photos/691668/pexels-photo-691668.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" /><br></br>
                </div>
                <Img src="https://images.pexels.com/photos/753626/pexels-photo-753626.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" /><br></br>
                <Img src="https://images.pexels.com/photos/459225/pexels-photo-459225.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
            </div>
        );
    }
}

export default App;
